import './styles.css';
import Header from './Header.js';
import BoardHeader from "./BoardHeader.js"

function App() {
  return (
    <div>
        <Header/>
        <BoardHeader/>
        <div className="bg-reddit_dark px-6 py-4">
          <div className="border border-biome_border text-gray-400"></div>
        </div>
    </div>
  );
}

export default App;
